pragma solidity ^0.8;

import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/utils/Base64.sol";

contract IdeaNfFT is ERC721URIStorage{
    using Counters for Counters.Counter;
    Counters.Counter public tokenId;

    constructor() ERC721 ("Idea NFT", "DIP"){}

    function getTokenURI(string memory _name, string memory _description, string memory _imageUrl, string memory _author) private pure returns (string memory){
        bytes memory dataURI = abi.encodePacked(
            "{",
            '"name": "',
            _name,
            '",',
            '"description": "',
            _description,
            '",',
            '"imageUrl": "',
            _imageUrl,
            '",',
            '"author": "',
            _author,
            '"'
            "}"
        );

        return string(
            abi.encodePacked(
                "data:application/json;base64,",
                Base64.encode(dataURI)
            )
        );
    }

    function createIdea(string memory _name, string memory _description, string memory _imageUrl, string memory _author) public returns (uint256){
        tokenId.increment();
        uint256 newTokenId = tokenId.current();
        _safeMint(msg.sender, newTokenId);
        _setTokenURI(newTokenId, getTokenURI(_name, _description, _imageUrl, _author));
        return newTokenId;
    }
}
